        <h1>안녕하세요, 김도이 입니다.</h1>
      </header>
      <div className="content">
        <p className="intro">안녕하세요! 저는 [이름]입니다. [직업/관심사]에 관심이 많고, [특기 또는 경험]을 가지고 있습니다.</p>
        <div className="social-links">
          <a href="https://github.com/rladkwls1108/React">GitHub</a>

        </div>
      </div>
      <footer className="footer">
        &copy; 2024 나의 웹 페이지
      </footer>
    </div>
  );
}

